require 'pry'
def num_subarrays_with_sum(nums, goal)
  subarrays_count = 0
  # binding.pry

  # if nums.select(&:zero?).count < nums.select(&:positive?).count
  if goal == 0
    for i in 0..nums.size - 1 do
      # p i: i
      sum = nums[i]
      # p sum: sum
      if sum == goal
        subarrays_count += 1
      end

      # binding.pry
      # break if nums[(i + 1)..nums.size - 1].sum < goal
      for j in (i + 1)..nums.size - 1 do
        # p "nums[i]: #{nums[i]}, nums[j]: #{nums[j]}"
        sum += nums[j]
        # p sumj: sum

        if sum == goal
          subarrays_count += 1
        elsif sum < goal
          next
        else
          break
        end
      end
    end
  else
    condensed_nums = condense_nums(nums)
    p condensed_nums: condensed_nums

    # for i in 0..condensed_nums.size - 1 do
    #   next unless condensed_nums[i] == 1

    #   sum = condensed_nums[i]
    #   if goal == 1
    #     subarrays_count += ((condensed_nums[i-1].to_i - 1) * (condensed_nums[i+1].to_i - 1))
    #   end

    #   window = find_window(condense_nums, i)

    # end
    window = find_window(condensed_nums, 0, goal)

    i = 1
    while (i + window) <= condensed_nums.size - 1
      subarrays_count += ((condensed_nums[i-1].to_i - 1) * (condensed_nums[i + window].to_i - 1))
      i += 2
    end

  end
  subarrays_count
end

def condense_nums(nums)
  condensed_nums = []
  zero_nums = 0

  nums.each_with_index do |num, i|
    if num == 0
      zero_nums += 1
      if i == nums.size - 1
        condensed_nums << zero_nums * -1
      end
    else
      condensed_nums << zero_nums * -1
      condensed_nums << 1
      zero_nums = 0
      if i == nums.size - 1
        condensed_nums << 0
      end
    end
  end

  condensed_nums
end

def find_window(condensed_nums, i, goal)
  window = nil
  sum = 0
  for j in (i+1)..condensed_nums.size - 1 do
    # p "i: #{i}, j: #{j}, nums[j]: #{condensed_nums[j]}, sum: #{sum}"
    next unless condensed_nums[j] == 1

    sum += condensed_nums[j]
    # p sum: sum
    if sum == goal
      # binding.pry
      # p i: i
      # p j: j
      # subarrays_count += 1
      # subarrays_count += (condensed_nums[i-1].to_i + condensed_nums[j+1].to_i) * -1
      # subarrays_count += ((condensed_nums[i-1].to_i - 1) * (condensed_nums[j+1].to_i - 1))
      window = j - i
      break
    elsif sum < goal
      next
    else
      break
    end
  end

  window
end

